import React from "react";
import { Link } from "react-router-dom";
import { useLocation } from 'react-router-dom';
import './css/MainPage.css';
import WorkerInfoCharts from "../organisms/WorkerInfoCharts"
import RecommendProducts from "../organisms/RecommendProducts"

const MainPage: React.FC = () => {

  let position: string

  const { state } = useLocation();
  switch(state) {
    case "f1111" :
      position = "総合職"
      break
    case "f2222" :
      pwInfo = "副主任"
      break
    case "f3333" :
      pwInfo = pwInfoJsonDC.personalinfo
      break
    default:
    pwInfo = pwInfoJsonR.personalinfo
  }

  return (
    <div>
      <header>
        <h4 style={{ textAlign: "right" }}>LoginID: {state}</h4>
      </header>
      <WorkerInfoCharts />
      <br />
      <br />
      <br />
      <RecommendProducts />
      <br />
      <br />
      <Link to="/">Loginページに戻る</Link>
      {console.log(typeof(state))}
    </div>
  );
};

export default MainPage;
